import SimpleImageSlider from "react-simple-image-slider";

class App extends React.Component {
    render() {
        const images = [
            { url: "/static/images/logo/icon.jpg" },
            { url: "/static/images/logo/icon.jpg" },
        ];

        return (
            <div>
                <SimpleImageSlider
                    width={896}
                    height={504}
                    images={images}
                />
            </div>
        );
    }
}
